import "./Numbers.scss";
import takiacademy from "../images/takiacademy.jpg";

const Numbers = () => {
  return (
    <section className="numbers">
      <div className="title">أرقام</div>
      <div className="description">
        تقي أكاديمي هي أوّل منصّة تعليميّة عبر الانترنت في تونس (منذ 2013) موجهة
        لتلامذة ..
        <span>الابتدائي، الأساسي و الثانوي</span>
      </div>

      <div className="content">
        <div className="image">
          <img src={takiacademy} />
        </div>
        <div className="cards">
          <Card />
          <Card />
          <Card />
          <Card />
          <Card />
          <Card />
        </div>
      </div>
    </section>
  );
};

export default Numbers;
